import http from './base-http-service';

const createClassroom = (classroom) => http.post('/classroom', classroom)
  .then(response => response.data);

const listClassroom = () => http.post('/classroom')
  .then(response => response.data);

export default {
  createClassroom,
  listClassroom
}
